      date: new Date(2022, 5, 15),
    },
    {
      id: 4,
      title: "New desk",
      amount: 500,
      date: new Date(2022, 5, 25),
    },
  ];
  return (
    <>
      <h1>Let's Get Started</h1>
      <ExpenseItem
        title={expense[0].title}
